import react, { useState } from "react";
import Title from "./Title";
import LogOut from "./buttons/logout";
import WriteArea from "./notebook components/WriteArea";
function Notebook(){
   const date = new Date();
   const fullDate = date.toDateString();
   const [noteData, setNoteData] = useState();
return(
    <div>
        <div className="TitleBar">
            <div>
            <Title/>
            </div>
            <div className="buttonBox">
                <LogOut/>
            </div>
        
        </div>
        {/* <h2>whats on your mind</h2> */}
        {/* <WriteArea/> */}
        <div className="TextWriting">
            <h2 className="Gratitude">Hi!, how have you been?</h2>
            <form onSubmit={handleSubmit}>
            <div className="form-group">
                <input type="email" class="form-control" id="exampleFormControlInput1" value={fullDate} readOnly='true' />
            </div>
            <input rows="8" cols="60" className="TextArea form-control" placeholder="What's on your mind?" value = {noteData} onChange={(e)=>setNoteData(e.target.value)}/>
            <button className="submit btn btn-dark">Submit</button>
            </form>
        </div>

    </div>);
}
export default Notebook;
